let atlasData = null;
let countryCode = null;
let countryData = null;

// Initialize the page
document.addEventListener('DOMContentLoaded', function() {
    // Get country code from URL
    const urlParams = new URLSearchParams(window.location.search);
    countryCode = urlParams.get('code');
    
    if (!countryCode) {
        showError('No country specified');
        return;
    }

    // Use embedded data directly
    atlasData = ATLAS_DATA;
    countryData = atlasData.countries[countryCode];
    
    if (!countryData) {
        showError('Country not found');
        return;
    }
    
    displayCountryData();
});

// Show error message
function showError(message) {
    document.getElementById('country-name').textContent = 'Error';
    document.getElementById('country-info').textContent = message;
}

// Display country data
function displayCountryData() {
    // Update header
    document.getElementById('country-name').textContent = countryData.name;
    document.getElementById('country-info').textContent = `${countryData.region} | ${countryData.incomeGroup}`;
    document.title = `${countryData.name} - Africa Building Regulations Atlas`;

    // Update overview cards
    document.getElementById('country-region').textContent = countryData.region;
    document.getElementById('country-income').textContent = countryData.incomeGroup;
    
    // Count available indicators
    const availableCount = countryData.indicators 
        ? Object.values(countryData.indicators).filter(ind => ind.value !== 'N/A' && ind.value !== 'nan').length 
        : 0;
    document.getElementById('indicators-available').textContent = `${availableCount} / ${Object.keys(atlasData.indicators).length}`;

    // Populate theme filter
    populateThemeFilter();
    
    // Display indicators
    displayIndicators();
    
    // Display summary
    displaySummary();
}

// Populate theme filter dropdown
function populateThemeFilter() {
    const filterSelect = document.getElementById('filter-theme');
    
    Object.keys(atlasData.themes).forEach(theme => {
        const option = document.createElement('option');
        option.value = theme;
        option.textContent = theme;
        filterSelect.appendChild(option);
    });

    filterSelect.addEventListener('change', function() {
        displayIndicators(this.value);
    });
}

// Display indicators grouped by theme
function displayIndicators(filterTheme = '') {
    const container = document.getElementById('indicators-container');
    container.innerHTML = '';

    Object.entries(atlasData.themes).forEach(([theme, indicatorIds]) => {
        if (filterTheme && filterTheme !== theme) return;

        const themeGroup = document.createElement('div');
        themeGroup.className = 'theme-group';
        
        const themeTitle = document.createElement('h3');
        themeTitle.textContent = theme;
        themeGroup.appendChild(themeTitle);

        indicatorIds.forEach(indId => {
            const indicator = atlasData.indicators[indId];
            const countryIndicator = countryData.indicators ? countryData.indicators[indId] : null;
            
            const value = countryIndicator ? countryIndicator.value : 'N/A';
            const valueClass = getValueClass(value);

            const card = document.createElement('div');
            card.className = `indicator-card ${valueClass}`;
            
            // Add source badge if available
            const sourceBadge = indicator.sourceAbbrev 
                ? `<span class="source-badge">${indicator.sourceAbbrev}</span>` 
                : '';
            
            card.innerHTML = `
                <div class="indicator-topic">${sourceBadge}${indicator.topic}</div>
                <span class="indicator-value ${valueClass}">${formatValue(value)}</span>
                ${indicator.source ? `<div class="indicator-source">Source: ${indicator.source}</div>` : ''}
            `;

            themeGroup.appendChild(card);
        });

        container.appendChild(themeGroup);
    });
}

// Get CSS class for a value
function getValueClass(value) {
    if (!value || value === 'N/A' || value === 'nan' || value === 'NaN') {
        return 'na';
    }
    
    const valueLower = String(value).toLowerCase().trim();
    
    if (valueLower === 'yes') return 'yes';
    if (valueLower === 'no') return 'no';
    if (valueLower.includes('partial') || valueLower.includes('some')) return 'partial';
    
    return 'na';
}

// Format value for display
function formatValue(value) {
    if (!value || value === 'nan' || value === 'NaN') {
        return 'N/A';
    }
    
    if (String(value).length > 100) {
        return String(value).substring(0, 100) + '...';
    }
    
    return value;
}

// Display summary statistics
function displaySummary() {
    const summaryGrid = document.getElementById('summary-grid');
    summaryGrid.innerHTML = '';

    Object.entries(atlasData.themes).forEach(([theme, indicatorIds]) => {
        let yesCount = 0;
        let noCount = 0;
        let naCount = 0;
        let otherCount = 0;

        indicatorIds.forEach(indId => {
            const countryIndicator = countryData.indicators ? countryData.indicators[indId] : null;
            const value = countryIndicator ? countryIndicator.value : 'N/A';
            const valueLower = String(value).toLowerCase().trim();

            if (!value || value === 'N/A' || value === 'nan') {
                naCount++;
            } else if (valueLower === 'yes') {
                yesCount++;
            } else if (valueLower === 'no') {
                noCount++;
            } else {
                otherCount++;
            }
        });

        const card = document.createElement('div');
        card.className = 'summary-card';
        card.innerHTML = `
            <h4>${theme}</h4>
            <div class="summary-stat">
                <span>Yes</span>
                <span style="color: #38a169">${yesCount}</span>
            </div>
            <div class="summary-stat">
                <span>No</span>
                <span style="color: #e53e3e">${noCount}</span>
            </div>
            <div class="summary-stat">
                <span>Other</span>
                <span style="color: #2b6cb0">${otherCount}</span>
            </div>
            <div class="summary-stat">
                <span>N/A</span>
                <span style="color: #718096">${naCount}</span>
            </div>
        `;

        summaryGrid.appendChild(card);
    });

    // Overall summary card
    let totalYes = 0, totalNo = 0, totalNA = 0, totalOther = 0;
    
    Object.values(atlasData.indicators).forEach(indicator => {
        const countryIndicator = countryData.indicators ? countryData.indicators[indicator.id] : null;
        const value = countryIndicator ? countryIndicator.value : 'N/A';
        const valueLower = String(value).toLowerCase().trim();

        if (!value || value === 'N/A' || value === 'nan') {
            totalNA++;
        } else if (valueLower === 'yes') {
            totalYes++;
        } else if (valueLower === 'no') {
            totalNo++;
        } else {
            totalOther++;
        }
    });

    const overallCard = document.createElement('div');
    overallCard.className = 'summary-card';
    overallCard.style.background = 'linear-gradient(135deg, #1a365d, #2b6cb0)';
    overallCard.style.color = 'white';
    overallCard.innerHTML = `
        <h4 style="color: white">Overall Summary</h4>
        <div class="summary-stat" style="border-color: rgba(255,255,255,0.2)">
            <span style="color: rgba(255,255,255,0.8)">Yes</span>
            <span style="color: #9ae6b4">${totalYes}</span>
        </div>
        <div class="summary-stat" style="border-color: rgba(255,255,255,0.2)">
            <span style="color: rgba(255,255,255,0.8)">No</span>
            <span style="color: #feb2b2">${totalNo}</span>
        </div>
        <div class="summary-stat" style="border-color: rgba(255,255,255,0.2)">
            <span style="color: rgba(255,255,255,0.8)">Other</span>
            <span style="color: #90cdf4">${totalOther}</span>
        </div>
        <div class="summary-stat" style="border-color: rgba(255,255,255,0.2)">
            <span style="color: rgba(255,255,255,0.8)">N/A</span>
            <span style="color: rgba(255,255,255,0.7)">${totalNA}</span>
        </div>
    `;

    summaryGrid.insertBefore(overallCard, summaryGrid.firstChild);
}
